os.trim=function(a){return a.replace(/^\s+|\s+$/g,"")};os.isAlphaNum=function(a){return((a>="a"&&a<="z")||(a>="A"&&a<="Z")||(a>="0"&&a<="9")||a=="_")};os.removeChildren=function(a){while(a.firstChild){a.removeChild(a.firstChild)}};os.appendChildren=function(a,b){if(a==b){return}while(a.firstChild){b.appendChild(a.firstChild)}};os.getPropertyGetterName=function(b){var a="get"+b.charAt(0).toUpperCase()+b.substring(1);return a};os.convertToCamelCase=function(g){var e=g.toUpperCase();var f=g.toLowerCase().split("_");var b=[];var a=f[0].length+1;b.push(f[0]);for(var c=1;c<f.length;++c){if(f[c].length>0){var d=e.charAt(a)+f[c].substring(1);b.push(d)}a+=f[c].length+1}return b.join("")};